import React from "react";
import { TextField } from "@material-ui/core";

function Addpost() {
  return (
    <div>
      <h1>hello</h1>
      <form className="form" noValidate autoComplete="off">
        <TextField id="outlined-basic" label="Outlined" variant="outlined" />
      </form>
    </div>
  );
}

export default Addpost;
